import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import Reset from "./generic/Reset";

ReactDOM.render(
  <React.StrictMode>
    <Reset>
      <App />
    </Reset>
  </React.StrictMode>,
  document.getElementById('root')
);
